        Klassisk: Lassens Sommerfavoritter\",\"numberOfTracks\":47,\"numberOfVideos\":0,\"creator\":{\"id\":0},\"description\":\"Redakt\xF8r
        WiMP Klassisk, Morten Lassen:\\r- Hvert \xE5r, n\xE5r sommeren n\xE6rmer seg,
        er det noen bestemte spor som begynner \xE5 snurre rundt i hodet p\xE5 meg
        - og det skjer helt automatisk. Det kan v\xE6re \\\"Sommeren\\\" fra Vivaldis
        Fire \xC5rstider, Svend S. Schultz' vidunderlige sang: \\\"Yndigt dufter Danmark\\\"
        eller \\\"Summertime\\\" fra Gershwins Porgy og Bess.\\rAlle disse og mange,
        mange flere - helt n\xF8yaktig 47 andre spor f\xE5r du p\xE5 denne listen,
        som jeg har satt sammen til deg. Musikk til en rolig stund ved stranden, til
        en deilig middag p\xE5 terrassen, til en god bok mens barna leker ved bassenget
